import React from 'react';
import Link from 'react-router-dom'

const Header=()=>{
  <ul>
    <li><Link to="/component1">first</Link></li>
    <li><Link to="/component2">second</Link></li>
    <li><Link to="/component3">third</Link></li>
  </ul>
}

export default Header;
